import React from 'react';
import s from './css/Inputs-right.module.css'

const Inputs_right = () => {

  return (<div className={s.block}>
    <label>Країна<input type="text"></input></label>

    <div className={s.flex}>
      <label >Місто<input type="text"></input></label>
      <label >Штат, район<input type="text"></input></label>
    </div>
    <label >Адреса<input type="text"></input></label>
    <label >Поштовий індекс<input type="text"></input></label>
  </div >
  );

}

export default Inputs_right;
